import TextBox from "/Users/kraken/Desktop/bulls/src/shared/Components/TextBox/TextBox.js";
import Buttons from "../../.././shared/Components/Buttons/Buttons";
import "./assets/index."

const Feeds = () =>{
    return (
        <div>
            <div className="postDetails">
                <div>
                    <h6 id="postedBy">Posted By</h6>
                </div>
                <div>
                    <div className="postText">
                        <p id="text">Hellu there</p>
                    </div>
                    <img className="postImage"></img>
                </div>
                <div>
                    <Buttons value="Like"/>
                    <Buttons value="Comment"/>
                </div>
            </div>
        </div>
    );
}

export default Feeds;
